import { FormGroup, FormLabel, TextField, FormControlLabel, Checkbox } from "@material-ui/core";

import React, { useState } from "react";


const Address = ({ userData, setUserData }) => {
    const [checkBoxValue, setCheckBoxValue] = useState(true);
    const [shipping, setShipping] = useState(true);

    const handleClick = () => {
        setCheckBoxValue((prevCheckBoxValue) => !prevCheckBoxValue);
        if (checkBoxValue) {
            setShipping(false);
        }
        else {
            setShipping(true);
        }
    }

    return (
        <FormGroup>
            <FormLabel>Primary Address</FormLabel>
            <div>
                { userData?.result?.private?.primaryAddress?.street ? 
                    <TextField
                        value={userData.result.private.primaryAddress.street}
                        label="Primary"
                        helperText="101 N. First St."
                        variant="outlined"
                    />
                    :
                    <TextField
                        label="Primary"
                        helperText="101 N. First St."
                        variant="outlined"
                    />
                }

                { userData?.result?.private?.primaryAddress?.city ? 
                    <TextField
                        value={userData.result.private.primaryAddress.city}
                        label="City"
                        helperText="Phoenix"
                        variant="outlined"
                    />
                    :
                    <TextField
                        label="City"
                        helperText="Phoenix"
                        variant="outlined"
                    />
                }
            </div>
            <hr></hr>
            <FormLabel>Shipping Address</FormLabel>
            <FormControlLabel control={<Checkbox name="address" checked={checkBoxValue} onClick={handleClick}/>} label="My shipping address is the same as my primary address"/>
            <div>
                { shipping ?
                    <TextField
                        label="Shipping"
                        value={userData.result.private.primaryAddress.street}
                        helperText="101 N. First St."
                        variant="outlined"
                        disabled={true}
                    />
                    :
                    <>
                        <TextField
                            label="Shipping"
                            value={userData.result.private.primaryAddress.street}
                            helperText="101 N. First St."
                            variant="outlined"
                            disabled={false}
                        />
                        <TextField
                            label="City"
                            helperText="Phoenix"
                            variant="outlined"
                            disabled={false}
                        />
                    </>
                }
                <TextField
                    label="City"
                    helperText="Phoenix"
                    variant="outlined"
                    disabled={shipping}
                />
            </div>
            <hr></hr>
            <FormLabel>Phone Number</FormLabel>
            <div>
                <TextField
                    label="Phone Number"
                    helperText="###-###-#####"
                    variant="outlined"
                />
            </div>
        </FormGroup>
    );
}

export default Address;
